INSERT INTO `comment` (`id`, `post_id`, `user_id`, `body`, `uuid`, `rating`, `createdAt`, `updatedAt`) VALUES ('1', '1', '77rVQHYHc2MHKtzLzDSIg8BAJJr1', 'There are a few reasons coming together I think. The most important of which I\'d firstly put down to a new culture where it\'s \'okay\' to feel depressed &/or anxious. In the past this wasn\'t accepted or deemed normal.', '', '3', '2021-01-09 00:02:01', '2021-01-09 00:02:01');
INSERT INTO `comment` (`id`, `post_id`, `user_id`, `body`, `uuid`, `rating`, `createdAt`, `updatedAt`) VALUES ('2', '1', 'Tnejof90iLcH1h6gYSv94S0vvZ03', 'Depression is real .There are many possible causes. It’s a combination of genetic, biological, environmental, and psychological factors.', '', '4', '2021-01-09 00:03:11', '2021-01-09 00:03:11');
INSERT INTO `comment` (`id`, `post_id`, `user_id`, `body`, `uuid`, `rating`, `createdAt`, `updatedAt`) VALUES ('3', '3', 'CQGgrsIbAweqrUErjmXpS8WgxU62', 'To answer your second point first (and quickly) - there is absolutely no reason why an architect can’t become a CTO. Indeed it is a well worn path for Software Architects to have come from a development background', '', '5', '2021-01-09 00:06:54', '2021-01-09 00:06:54');
INSERT INTO `comment` (`id`, `post_id`, `user_id`, `body`, `uuid`, `rating`, `createdAt`, `updatedAt`) VALUES ('4', '4', 'DWBrcsBQhCVl2dbF9PKfxPytkBW2', 'That all depends on what you use as an alternative to sugar after giving the awful stuff up. See, if you are eating artificial so-called \"fat or carb-free\" sugar, and eating those day in day out, perhaps even drinking diet coke or lemonade.', '', '3', '2021-01-09 00:18:49', '2021-01-09 00:18:49');
INSERT INTO `comment` (`id`, `post_id`, `user_id`, `body`, `uuid`, `rating`, `createdAt`, `updatedAt`) VALUES ('5', '5', 'MtiBMS4ARJWGe9i3JzWbXKyX9Sh2', 'I had a new boss who didn\'t know what he was doing and he didn\'t want to ask up for help. He had gotten his promotion against company policy because he knew he right people, and he had no past experience.', '', '4', '2021-01-09 00:22:14', '2021-01-09 00:22:14');
